language.SPARQL:
SELECT ?s1  WHERE {	 ?s1  ?p1  <http://dbpedia.org/ontology/Airline> . 
	 ?s1  <http://dbpedia.org/property/frequentFlyer>  ?o2 . 
} ORDER BY DESC(?o2)   LIMIT 1

SELECT ?o1  WHERE {	 <http://dbpedia.org/resource/Mountain,_North_Dakota>  <http://dbpedia.org/ontology/isPartOf>  ?o1 . 
	 ?o1  <http://dbpedia.org/ontology/areaTotal>  ?o2 . 
} ORDER BY DESC(?o2)   LIMIT 1

SELECT ?s1  WHERE {	 ?s1  ?p1  <http://dbpedia.org/resource/Serie_A> . 
	 ?s1  <http://dbpedia.org/ontology/birthDate>  ?o2 . 
} ORDER BY DESC(?o2)   LIMIT 1

SELECT ?s1  WHERE {	 ?s1  ?p1  <http://dbpedia.org/resource/BBC> . 
	 ?s1  <http://dbpedia.org/property/series>  ?o2 . 
} ORDER BY DESC(?o2)   LIMIT 1
